import './App.css';
import React from "react";
import { useNavigate, Routes, Route } from "react-router-dom";
import homePage from './/components/homePage/homePage.js'

function App() {
  return (
    <Router>
        <Route path="/" exact component={homePage} />
    </Router>
  );
}

export default App;
